import Iframe from 'react-iframe';
import './App.css';

function TestElement() {
  return <h1>Tyler</h1>;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Ironsight - Systems Analysis and Design
        </p>
      </header>
        <Iframe url="https://netdata.tylerharrison.dev/"
        width="99%"
        height="800px"
        id="netdata"
        className="netdata"
        display="initial"
        position="relative"
        frameBorder="0"/>
    <TestElement />
    </div>
  );
}


export default App;
